import React, { Component } from 'react';
import axios from 'axios';


class EntityDesigner extends Component { 
  constructor(props) {
    super(props);

    this.state = {
      data: null,
    };
  }

  render() {
    return (<div className="App">
      <h1>The Entity Designer</h1> 
      {this.state.data}
      </div>);
  }

  componentDidMount() {
    axios.get('http://localhost:8080/models')
    .then(json => json.data.map(result => (
      {
        id: `${result.id}`,
        orgId: `${result.orgId}`,
        modelTypeId: `${result.modelTypeId}`,
        name: `${result.name}`,
        content: `${result.content}`
      })))
    .then(newData => this.setState({id: newData, name: newData}))
    .catch(error => alert(error)) 
     /* axios.get('http://localhost:8080/models')
      .then(json => console.log(json.data[0].id)) */

  }
}

export default EntityDesigner
